import React from 'react'
import { NaverMap, Marker } from 'react-naver-maps'
import markerPng from './marker_v2.png'

class App extends React.Component {
  render () {
    return (
      <div>
        <h1>NoKiz</h1>
        <NaverMap 
          style={{
            width: '80%',
            height: '600px',
          }}
          defaultCenter={{ lat: 37.3595704, lng: 127.17002399 }}
          defaultZoom={10}
        />
        <NaverMap>
      {markers.map(marker => (
        <Marker 
          lat={marker.lat} 
          lng={marker.lng}
          icon={{
            url: markerPng,
            size:{width:24,height:32},
            scaledSize:{width:24,height:32},
            anchor: {x:12, y:32}
          }}
          shape={{coords: [0,12, 12,0, 24,12, 12,32, 0,12], type: 'poly'}}  // click mask shape
        />
      ))}
    </NaverMap>
      </div>
    )
  }
}

export default App
